int main(int argc, char** argv) {
  // redirect yyin
  yyin = fopen(argv[1], "r");
  // redirect yyout if you want, or stdout by default
  // yyout = stdout;
  int c;
  // keep calling yylex
  while (c = yylex()) {
    out("TokenName: %s\n", TokenName[c]);
    ECHO;
    // printf yytext
    out("yyleng: %d | yylineno: %d\n", yyleng, yylineno);
  }
  fclose(yyin);
  return 0;
}
